import "./styles.css";
//import axios from "axios";


export default function Contact(props) {
    

    return (
        <div className="Home">
        <body>
        <nav>
        <div className="menu">
            <div class="logo">
                    <a href="/">Portfolio</a>
            </div>
                    <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/career">Career</a></li>
                    <li><a href="/contact">Contact</a></li>
                    <li><a href="/login">Login</a></li>
                    </ul>
        </div>
        </nav>
       
        </body></div>
    );

}
